dispatch:
- url: "staging.boxwise.co/v2*"
  service: v2-staging
- url: "demo.boxwise.co/v2*"
  service: v2-demo
- url: "app.boxwise.co/v2*"
  service: v2-production
- url: "staging.boxwise.co/*"
  service: default
- url: "demo.boxwise.co/*"
  service: demo
- url: "app.boxwise.co/*"
  service: production
- url: "market.drapenihavet.no/*"
  service: production
- url: "www.market.drapenihavet.no/*"
  service: production
